script: |
  super -f tsv -I q911.sql | sort > q911.out

vector: true

inputs:
  - name: q911.sql
    data: |
      SELECT COUNT ( * ) / COUNT ( * ) + 31 AS col1 FROM tab1 AS cor0 WHERE - col2 - + col0 + - 52 - + col0 * + col0 / + col0 NOT BETWEEN + 32 AND - 13;
  - name: tab1

outputs:
  - name: q911.out
    data: |
      32
